        console.log(this.albums);
    },
    methods: {
        async importAll() {
            this.allImportLoading = true;
            for (let i = this.albums.length - 1; i >= 0; i--) {
                let album = this.albums[i];
                this.statusText = `[${i + 1} / ${this.albums.length}] Importing "${album.title}...`
                await this.importAlbum(album.title, album.id, album.coverPhotoMediaItemId, false);
            }
            this.statusText = 'Done importing all';
            this.allImportLoading = false;
        },
        async importAlbum(title: string, albumId: string, coverMediaItemId: string, redirect = true) {
            this.importLoading = true;
            this.loadingAlbumIds.push(albumId);
            let response = null as null | { mediaItems: any[], nextPageToken: string };
            let mediaItems = [];
            do {
                response = await fetch(
                    `https://photoslibrary.googleapis.com/v1/mediaItems:search`,
                    {
                        method: 'POST',
                        body: JSON.stringify({
                            pageSize: 100,
                            albumId,
                            pageToken: response?.nextPageToken,
                        }),
                        headers: {Authorization: `Bearer ${this.accessToken}`},
                    },
                ).then(f => f.json());
                if (response !== null && Array.isArray(response.mediaItems)) {
                    mediaItems.push(...response.mediaItems);
                }
            } while (response?.nextPageToken);
            console.log('import response', response);
            let coverFilename = mediaItems.find((m: any) => m.id === coverMediaItemId)?.filename;
            console.log("Cover file name", coverFilename);
            let result = await this.$store.dispatch('apiRequest', {
                url: 'photos/importAlbum',
                body: {
                    name: title,
                    filenames: mediaItems.map((m: any) => m.filename),
                    coverFilename,
                },
            });
            if (!result.success) {
                await this.$store.dispatch('addSnack', {
                    text: `Couldn't find any images from "${title}" in your photos`,
                    timeout: 10000,
                });
            } else {
                this.$store.dispatch('updateAlbums').then();
                let successes = result.successes.reduce((a: number, b: number) => a + b);
                if (successes < result.successes.length) {
                    await this.$store.dispatch('addSnack', {
                        text: `Some photos from "${title}" couldn't be imported. ${
                            result.successes.length - successes
                        } / ${result.successes.length} items not found.`,
                        timeout: 300000000,
                    });
                }
                if (redirect)
                    await this.$router.push(`/album/${result.albumId}`);
            }
            console.log('import success', result);
            this.loadingAlbumIds.splice(this.loadingAlbumIds.indexOf(albumId), 1);
            this.importLoading = false;
        },
        async findAlbums() {
            this.findLoading = true;
            let response = await fetch(
                `https://photoslibrary.googleapis.com/v1/albums?pageSize=${20}`,
                {
                    headers: {Authorization: `Bearer ${this.accessToken}`},
                },
            ).then(f => f.json());
            console.log({response})
            this.albums = response.albums;
            while (response.nextPageToken) {
                response = await fetch(
                    `https://photoslibrary.googleapis.com/v1/albums?pageSize=${
                        20
                    }&page_token=${response.nextPageToken}`,
                    {
                        headers: {Authorization: `Bearer ${this.accessToken}`},
                    },
                ).then(f => f.json());
                if (Array.isArray(response.albums))
                    this.albums.push(...response.albums);
            }
            console.log(this.albums);
            this.findLoading = false;
            return this.albums;
        },
        async detectCode() {
            if (location.href.includes('code=')) {
                let code = location.href.split('code=')?.[1].split('&')[0];
                console.log('code', code);
                if (!code) return;

                let tokens = await this.$store.dispatch('apiRequest', {
                    url: 'photos/googleAuthTokens',
                    body: {
                        clientId: this.clientId,
                        clientSecret: this.clientSecret,
                        redirectUrl: this.redirectUrl,
                        code: decodeURIComponent(code),
                    },
                });
                await this.$router.push('/settings/import');
                console.log('tokens', tokens);
                this.$store.commit('refreshToken', tokens.refresh_token);
                this.accessToken = tokens.access_token;
                await this.findAlbums();
            }
        },
        async loadAuth() {
            this.findLoading = true;
            if (this.$store.state.google.refreshToken !== '' && this.clientSecret && this.clientId) {
                let response = await fetch('https://oauth2.googleapis.com/token', {
                    method: 'POST',
                    body: JSON.stringify({
                        "client_id": this.clientId,
                        "client_secret": this.clientSecret,
                        "grant_type": "refresh_token",
                        "refresh_token": this.$store.state.google.refreshToken
                    }),
                }).then(t => t.json());
                this.accessToken = response.access_token;
                await this.findAlbums();
            } else {
                let url = await this.$store.dispatch('apiRequest', {
                    url: 'photos/googleAuthUrl',
                    body: {
                        clientId: this.clientId,
                        clientSecret: this.clientSecret,
                        redirectUrl: this.redirectUrl,
                    },
                }).then(u => u.url);
                console.log(url);
                location.href = url;
            }
            this.findLoading = false;
        },
    },
    computed: {
        redirectUrl() {
            return location.origin + location.pathname;
        },
        clientId: {
            get(): string {
                return this.$store.state.google.clientId;
            },
            set(v: string) {
                return this.$store.commit('clientId', v);
            },
        },
        clientSecret: {
            get(): string {
                return this.$store.state.google.clientSecret;
            },
            set(v: string) {
                return this.$store.commit('clientSecret', v);
            },
        },
    },
});
</script>

